class Historial {
  constructor(idHistorial, idInsumo, cantidad, denominacion) {
    this.idHistorial = idHistorial;
    this.idInsumo = idInsumo;
    this.cantidad = cantidad;
    this.denominacion = denominacion;
  }
}
export default Historial;
